import {
  FaLinkedin,
  FaGithub,
  FaEnvelope,
  FaCloudDownloadAlt,
} from "react-icons/fa";

const Contact = () => {
  return (
    <div>
      <Layout>
        <div className="contCont">
          <div className="flex">
            This is where I need to figure out what to put
          </div>

          <div className="sidebar flex">
            <a
              href="linkedin.com/in/lola-kasimova-9533a794"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaLinkedin
                size={40}
                style={{
                  color: "blue",
                }}
              />
            </a>
            <a
              href="https://github.com/19Lola89"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaGithub size={40} style={{ color: "black" }} />
            </a>
            <a className="envelope-logo" href="mailto:lolakasimova@icloud.com">
              <FaEnvelope size={40} style={{ color: "green" }} />
            </a>
            <a href="/path/to/file" download>
              <FaCloudDownloadAlt size={40} style={{ color: "pink" }} />
            </a>
          </div>
        </div>
      </Layout>
    </div>
  );
};

export default Contact;
